import React from 'react';
import { Nav, Container } from 'react-bootstrap'
function Navbar(userDetails) {
    return (
        <div>
            <Navbar expand="lg" variant="light" bg="light">
                <Container>
                    <Navbar.Brand href="#">Navbar</Navbar.Brand>
                </Container>
            </Navbar>
        </div >
    )
}

export default Navbar;

